import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu-white.svg'

function NavbarLogin() {
    return (
        <span class="navbar-child" id="login-span">
            <button id="login">
            </button>
        </span>
    )
}

function NavbarHamburger() {
    return (
        <span class="navbar-child" id="hamburger-span">
            <button id="hamburger">
            </button>
        </span>
    )
}

function NavbarTitle() {
    return (
        <span class="navbar-child">
            Museum
        </span>
    )
}

function Navbar() {
    return (
        <div class="navbar-main navbar-position">
            <NavbarHamburger />
            <NavbarTitle />
            <NavbarLogin />
        </div>
    )
}

function Page() {
    return (
        <Navbar />
    )
}

ReactDOM.render(
    <Page />,
    document.getElementById('root')
);
